import BarChart from 'react-bar-chart';

const data = [
    {text: 'Man', value: 500}, 
    {text: 'Woman', value: 300} 
  ];

const margin = {top: 20, right: 20, bottom: 30, left: 40};

const Bar = () => {
    return (
        <div>
            <BarChart 
                data={data}
                height={500}
                margin={margin}
                width={100}
            />
        </div>
    )
}

export default Bar;
